import { Container } from "@mui/material";
import React from "react";
import image from "../../../../assets/images/service_bg.png";

const Section2 = () => {
  return (
    <div
      style={{
        backgroundImage: "url(" + image + ")",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        padding: 16,
      }}
    >
      <Container></Container>
    </div>
  );
};

export default Section2;
